const galleriFields = `
	_createdAt,
	_id,
	'img': image{
		alt,
		image{
			asset->{url}
		},
	},
    'raw': image,
`;

export const getImg = async () => {
    const images = await client.fetch(
      `*[_type == "navigation" && location == $slug]{${galleriFields}}`,
    );
    return images?.[0];
  };
